import React from "react";
import "../../styles/Skills.css";
import { SkillsProps } from "../../types/SkillProps";

export function Skills({skills}:SkillsProps) {
    return (
        <div id="Skills">
            <h1>Skills</h1>
            <ul>
                {
                    skills.map((skill) => {
                        <li key={skill.id}>{skill.skill}</li>
                       })

                }
            </ul>
        </div>
    );
}
